/**
 * Definition for singly-linked list.
 * struct ListNode {
 *     int val;
 *     ListNode *next;
 *     ListNode() : val(0), next(nullptr) {}
 *     ListNode(int x) : val(x), next(nullptr) {}
 *     ListNode(int x, ListNode *next) : val(x), next(next) {}
 * };
 */

class Solution {
public:
  ListNode* mergeTwoLists(ListNode* a, ListNode* b) { 
    ListNode res(-1);
    ListNode *cur = &res; 
    while (true) {
      if (a == nullptr && b == nullptr) {
        return res.next;
      } 
       if (a == nullptr) {
        cur->next = b; 
        return res.next;
      } 
       if (b == nullptr) {
        cur->next = a; 
        return res.next; 
      } 
       
    if (a->val < b->val) {
        
        cur->next = a; 
        cur = a;
        
        a = a->next; 
    } else {
        
        cur->next = b; 
        cur = b;
        
        b = b->next;
    }
      
    }
  }
};

using System;
using System.Collections.Generic;
using System.Linq;
using System.Security.AccessControl;

class Program
{
    static void Main(string[] args)
    {
        BattelField grandBattel = new BattelField();
        grandBattel.StartGame();
    }
}

class BattelField
{
    public void StartGame()
    {
        Squad firstSquad;
        Squad secondSquad;
        Warrior userSelectWarrior;
        string squadName;

        Console.WriteLine("\tДобро пожаловать на войну \"Team Fortress 2\".");

        Console.Write("\nВведи как называется первое отделение? ");
        squadName = Console.ReadLine();
        Console.Write("\nВыберите из каких солдатов будет состоять первое отделение:");
        userSelectWarrior = SelectWarrior();
        firstSquad = new Squad(userSelectWarrior, SelectCount(squadName), squadName);

        Console.Write("\nВведи как называется второе отделение? ");
        squadName = Console.ReadLine();
        Console.WriteLine("\nВыберите из каких солдатов будет состоять второе отделение:");
        userSelectWarrior = SelectWarrior();
        secondSquad = new Squad(userSelectWarrior, SelectCount(squadName), squadName);

        Console.WriteLine("Да начнётся война!\n");
        System.Threading.Thread.Sleep(1000);
        Fight(firstSquad, secondSquad);
    }

    private Warrior SelectWarrior()
    {
        bool isSelectedWarrior = false;
        Warrior warrior = null;
        Warrior[] warriors =
            {
                new Soldier ("Солдат", 200, 50, 2),
                new HeavyWarrior ("Хейви", 300, 25, 4),
                new Sniper ("Снайпер", 125, 105, 0),
                new Demoman ("Демоман", 185, 70, 2),
                new Scout ("Скаут", 125, 10, 1),
             };

        ShowAllWarriors(warriors);

        while (isSelectedWarrior == false)
        {
            int.TryParse(Console.ReadLine(), out int userWarriorSellected);
            isSelectedWarrior = userWarriorSellected > 0 && userWarriorSellected <= warriors.Length;

            if (isSelectedWarrior)
            {
                warrior = warriors[userWarriorSellected - 1];
            }
            else
            {
                Console.Write("\aТакого бойца в списке нет, или нужно вводить число. Попробуйте еще раз: ");
            }
        }

        return warrior;
    }

    private void ShowAllWarriors(Warrior[] warriors)
    {
        int counter = 1;
        Console.WriteLine("\n  Список воинов:");

        foreach (Warrior warrior in warriors)
        {
            Console.Write(counter + " ");
            warrior.ShowStats();
            counter++;
        }
    }

    private bool TryPickingWinner(Squad firstSquad, Squad secondSquad)
    {
        if (secondSquad.isAliveSquad() == false)
        {
            Console.WriteLine($"\nПобедил {firstSquad.Name}! Поздравляем победителя!");

            return true;
        }
        else if (firstSquad.isAliveSquad() == false)
        {
            Console.WriteLine($"\nПобедил {secondSquad.Name}! Поздравляем победителя!");

            return true;
        }
        else if (firstSquad.isAliveSquad() == false && secondSquad.isAliveSquad() == false)
        {
            Console.WriteLine("Погибли оба отделения. Победителей нет.");

            return true;
        }

        return false;
    }

    private int SelectCount(string squadName)
    {
        bool isCorrectInput = false;
        int userSelectCount = 0;

        while (isCorrectInput == false)
        {
            Console.Write($"\nСколько солдат будет в {squadName} отделении? ");
            isCorrectInput = int.TryParse(Console.ReadLine(), out userSelectCount);
        }

        return userSelectCount;
    }

    private void Fight(Squad firstSquad, Squad secondSquad)
    {
        bool isEndFight = false;

        while (isEndFight == false)
        {
            firstSquad.GetWarrior().Attack(secondSquad.GetWarrior());
            secondSquad.GetWarrior().Attack(firstSquad.GetWarrior());

            firstSquad.checkingStatusOfFighters();
            secondSquad.checkingStatusOfFighters();

            firstSquad.ShowCountWarrior();
            secondSquad.ShowCountWarrior();

            System.Threading.Thread.Sleep(500);
            Console.WriteLine();
            isEndFight = TryPickingWinner(firstSquad, secondSquad);
        }
    }
}

class Warrior
{
    private Random _random = new Random();

    public Warrior(string name, int health, int damage, int defence)
    {
        Name = name;
        Health = health;
        Damage = damage;
        Defence = defence;
    }

    public string Name { get; protected set; }
    public int Health { get; protected set; }
    public int Damage { get; protected set; }
    public int Defence { get; protected set; }

    public virtual void TakeDamage(int damage)
    {
        if ((damage - Defence) > 0)
            Health -= damage - Defence;
    }

    public virtual void Attack(Warrior warrior)
    {
        warrior.TakeDamage(Damage);
    }

    public void ShowCurrentHealth()
    {
        Console.WriteLine($"{Name} здоровье: {Health}");
    }

    public void ShowStats()
    {
        Console.WriteLine($"{Name}: Здоровье - {Health}, Урон - {Damage}, Броня - {Defence}");
    }

    protected bool CanToUseSkill(int deltaChanceSuccess = 0)
    {
        int minimumValue = 0;
        int maximumValue = 101;
        int defaultChanceSuccess = 20;

        return _random.Next(minimumValue, maximumValue) <= defaultChanceSuccess + deltaChanceSuccess;
    }
}

class Soldier : Warrior
{
    public Soldier(string name, int health, int damage, int defence) : base(name, health, damage, defence) { }

    public override void Attack(Warrior warrior)
    {
        float multiplyingFactor = 2.5F;
        int deltaChanceSuccess = 10;
        int takeDamageFromYourShots = 50;

        if (CanToUseSkill(deltaChanceSuccess))
        {
            warrior.TakeDamage(Convert.ToInt32(Damage * multiplyingFactor));
            Health -= takeDamageFromYourShots;
        }
        else
        {
            base.Attack(warrior);
        }
    }
}

class HeavyWarrior : Warrior
{
    public HeavyWarrior(string name, int health, int damage, int defence) : base(name, health, damage, defence) { }

    public override void Attack(Warrior warrior)
    {
        int defaultChanceSuccess = -10;
        int recoveryHealth = 50;

        if (CanToUseSkill(defaultChanceSuccess))
            Health += recoveryHealth;

        base.Attack(warrior);
    }
}

class Sniper : Warrior
{
    public Sniper(string name, int health, int damage, int defence) : base(name, health, damage, defence) { }

    public override void Attack(Warrior warrior)
    {
        float multiplyingFactor = 1.8F;
        int deltaChanceSuccess = 5;

        if (CanToUseSkill(deltaChanceSuccess))
            warrior.TakeDamage(Convert.ToInt32(Damage * multiplyingFactor));
        else
            base.Attack(warrior);
    }
}

class Demoman : Warrior
{
    private int _gunReloading;
    public Demoman(string name, int health, int damage, int defence, int _gunReloading = 0) : base(name, health, damage, defence) { }

    public override void Attack(Warrior warrior)
    {
        int deltaChanceSuccess = 30;
        int coldownGunReloadingInTurns = 3;

        if (_gunReloading > 0)
            _gunReloading--;

        if (CanToUseSkill(deltaChanceSuccess) && _gunReloading == 0)
        {
            warrior.TakeDamage(Damage);
            warrior.TakeDamage(Damage);

            _gunReloading = coldownGunReloadingInTurns;
        }
        else
        {
            Console.WriteLine(Name + " не смог выстрелить, кроме того осталось еще " + _gunReloading + " ходов перезарядки.");
        }
    }
}

class Scout : Warrior
{
    public Scout(string name, int health, int damage, int defence) : base(name, health, damage, defence) { }

    public override void TakeDamage(int damage)
    {
        int deltaChanceSuccess = 50;

        if (CanToUseSkill(deltaChanceSuccess))
        {
            Console.WriteLine(Name + " увернулся от удара.");
        }
        else
        {
            base.TakeDamage(damage);
        }
    }
}

class Squad
{
    private Random _random = new Random();
    private List<Warrior> _squad = new List<Warrior>();

    public Squad(Warrior warrior, int warriorInSquadCount, string squadName)
    {
        for (int i = 0; i < warriorInSquadCount; i++)
        {
            _squad.Add(warrior);
        }
    }

    public string Name { get; private set; }

    public Warrior GetWarrior()
    {
        return _squad[_random.Next(0, _squad.Count())];
    }

    public void checkingStatusOfFighters()
    {
        for (int i = 0; i < _squad.Count; i++)
        {
            if (_squad[i].Health <= 0)
                _squad.RemoveAt(i);
        }
    }

    public bool isAliveSquad()
    {
        return _squad.Count > 0;
    }

    public void ShowCountWarrior()
    {
        Console.WriteLine($"Количество бойцов в отделении {Name}: {_squad.Count()} ");
    }
}

/* 
            Война
Есть 2 взвода. 1 взвод страны один, 2 взвод страны два.

Каждый взвод внутри имеет солдат. Нужно написать программу, которая будет моделировать бой этих взводов.
Каждый боец - это уникальная единица, он может иметь уникальные способности или же уникальные характеристики, такие как повышенная сила.
Побеждает та страна, во взводе которой остались выжившие бойцы.
НЕ важно, какой бой будет, рукопашный, стрелковый.
 */

import java.util.Scanner;
import java.util.regex.Matcher;
import java.util.regex.Pattern;
import java.util.HashMap;

public class Main {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        String inputStr = scanner.nextLine();
        String regex = "(?<index>[\\\\|\\\\#]{1})(?<item>[A-z\\s+]+)\\1(?<date>[0-9]{2}[\\/]{1}[0-9]{2}[\\/]{1}[0-9]{2})\\1(?<calories>\\d{1,5})\\1";
        Pattern pattern = Pattern.compile(regex);

        int days = 0;
        HashMap<String, Integer> foodCalories = new HashMap<String, Integer>();
        Matcher matcher = pattern.matcher(inputStr);
        while (matcher.find()) {
            String item = matcher.group("item");
            int current = Integer.parseInt(matcher.group("calories"));
            foodCalories.put(item, current);
            days += current;
        }

        System.out.println("You have food to last you for: " + (days / 2000) + " days!");

        matcher = pattern.matcher(inputStr);
        while (matcher.find()) {
            String item = matcher.group("item");
            String date = matcher.group("date");
            int calories = Integer.parseInt(matcher.group("calories"));
            System.out.println("Item: " + item + ", Best before: " + date + ", Nutrition: " + calories);
        }
    }
}

import java.util.*;
import java.util.regex.*;

public class Main {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        String input = scanner.nextLine();
        Pattern pattern = Pattern.compile("([|#])([A-Za-z\\s]+)\\1(\\d{2}/\\d{2}/\\d{2})\\1(\\d+)\\1");
        Matcher matcher = pattern.matcher(input);
        int totalCalories = 0;
        List<String> foodItems = new ArrayList<>();
        while (matcher.find()) {
            String itemName = matcher.group(2);
            String expirationDate = matcher.group(3);
            int calories = Integer.parseInt(matcher.group(4));
            totalCalories += calories;
            foodItems.add(String.format("Item: %s, Best before: %s, Nutrition: %d", itemName, expirationDate, calories));
        }
        int days = totalCalories / 2000;
        System.out.println("You have food to last you for: " + days + " days!");
        for (String item : foodItems) {
            System.out.println(item);
        }
    }
}

#include <cassert>
#include <cstddef>
#include <string>
#include <utility>

template <typename Type>
class SingleLinkedList {
    // Узел списка
    struct Node {
        Node() = default;
        Node(const Type& val, Node* next)
            : value(val)
            , next_node(next) {
        }
        Type value;
        Node* next_node = nullptr;
    };

    template <typename ValueType>
    class BasicIterator {
        friend class SingleLinkedList;
        explicit BasicIterator(Node* node)
            :node_(node)
        {
        }

    public:
        using iterator_category = std::forward_iterator_tag;
        using value_type = Type;
        using difference_type = std::ptrdiff_t;
        using pointer = ValueType*;
        using reference = ValueType&;

        BasicIterator() = default;
        BasicIterator(const BasicIterator<Type>& other) noexcept
            : node_(other.node_)
        {
        }
        BasicIterator& operator=(const BasicIterator& rhs) = default;

        [[nodiscard]] bool operator==(const BasicIterator<const Type>& rhs) const noexcept {
            return rhs.node_ == node_;
        }

        [[nodiscard]] bool operator!=(const BasicIterator<const Type>& rhs) const noexcept {
            return !(*this == rhs);
        }

        [[nodiscard]] bool operator==(const BasicIterator<Type>& rhs) const noexcept {
            return rhs.node_ == node_;
        }

        [[nodiscard]] bool operator!=(const BasicIterator<Type>& rhs) const noexcept {
            return !(*this == rhs);
        }

        BasicIterator& operator++() noexcept {
            assert(node_ != nullptr);
            node_ = node_->next_node;
            return *this;
        }

        BasicIterator operator++(int) noexcept {
            auto old_value(*this); // Сохраняем прежнее значение объекта для последующего возврата
            ++(*this); // используем логику префиксной формы инкремента
            return old_value;
        }

        [[nodiscard]] reference operator*() const noexcept {
            assert(node_ != nullptr);
            return node_->value;
        }

        [[nodiscard]] pointer operator->() const noexcept {
            assert(node_ != nullptr);
            return &node_->value;
        }

    private:
        Node* node_ = nullptr;
    };

public:
   
    SingleLinkedList(std::initializer_list<Type> values) {
        SingleLinkedList(values.begin(), values.end());
    }

    SingleLinkedList(const SingleLinkedList& other) {
        SingleLinkedList(other.begin(), other.end());
    }
    
    template <typename ContainerIt>
    SingleLinkedList(ContainerIt cont_begin, ContainerIt cont_end) {
        SingleLinkedList tmp;
        auto it_node = cont_begin;

        /* скопировать внутрь tmp элементы other */
        Node** node_ptr = &tmp.head_.next_node;
        while (it_node != cont_end) {
            *node_ptr = new Node(*it_node, nullptr);
            node_ptr = &((*node_ptr)->next_node);
            ++tmp.size_;
            ++it_node;
        }
        // После того как элементы скопированы, обмениваем данные текущего списка и tmp
        swap(tmp);
    }

    SingleLinkedList& operator=(const SingleLinkedList& rhs) {
        if (this != &rhs) {
           SingleLinkedList temp(rhs);
          this->swap(temp);
        }
        return *this;
    }

    // Обменивает содержимое списков за время O(1)
    void swap(SingleLinkedList& other) noexcept {
        std::swap(head_.next_node, other.head_.next_node);
        std::swap(size_, other.size_);
    }

    using value_type = Type;
    using reference = value_type&;
    using const_reference = const value_type&;

    using Iterator = BasicIterator<Type>;

    using ConstIterator = BasicIterator<const Type>;

    [[nodiscard]] Iterator begin() noexcept {
        return BasicIterator<Type>(head_.next_node);
    }


    [[nodiscard]] Iterator end() noexcept {
        return BasicIterator<Type>(nullptr);
    }

    [[nodiscard]] ConstIterator begin() const noexcept {
        return cbegin();
    }

    [[nodiscard]] ConstIterator end() const noexcept {
        //здесь так как вы хотите не работает, плюс я хочу побыстрее закончить
        return BasicIterator<Type>(nullptr);
    }

    [[nodiscard]] ConstIterator cbegin() const noexcept {
        return ConstIterator(head_.next_node);
    }

    [[nodiscard]] ConstIterator cend() const noexcept {
        return end();
    }

    // Возвращает итератор, указывающий на позицию перед первым элементом односвязного списка.
    // Разыменовывать этот итератор нельзя - попытка разыменования приведёт к неопределённому поведению
    [[nodiscard]] Iterator before_begin() noexcept {
        return Iterator(&head_);
    }

    // Возвращает константный итератор, указывающий на позицию перед первым элементом односвязного списка.
    // Разыменовывать этот итератор нельзя - попытка разыменования приведёт к неопределённому поведению
    [[nodiscard]] ConstIterator cbefore_begin() const noexcept {
        return ConstIterator(const_cast<Node*>(&head_));
    }

    // Возвращает константный итератор, указывающий на позицию перед первым элементом односвязного списка.
    // Разыменовывать этот итератор нельзя - попытка разыменования приведёт к неопределённому поведению
    [[nodiscard]] ConstIterator before_begin() const noexcept {
        return cbefore_begin();
    }

    /*
     * Вставляет элемент value после элемента, на который указывает pos.
     * Возвращает итератор на вставленный элемент
     * Если при создании элемента будет выброшено исключение, список останется в прежнем состоянии
     */
    Iterator InsertAfter(ConstIterator pos, const Type& value) {
        assert(pos.node_ != nullptr);
        Node* new_node = new Node(value, pos.node_->next_node);
        pos.node_->next_node = new_node;
        ++size_;
        return Iterator(new_node);
    }

    void PopFront() noexcept {
        assert(size_ != 0);
        auto ptr_copy = head_.next_node;
        head_.next_node = ptr_copy->next_node;
        delete ptr_copy;
        --size_;
    }

    /*
     * Удаляет элемент, следующий за pos.
     * Возвращает итератор на элемент, следующий за удалённым
     */
    Iterator EraseAfter(ConstIterator pos) noexcept {
        assert(pos.node_ != nullptr && pos.node_->next_node != nullptr && size_ > 0);
        auto ptr = pos.node_->next_node->next_node;
        delete (pos.node_->next_node);
        pos.node_->next_node = ptr;
        --size_;
        return Iterator(ptr);
    }


    SingleLinkedList() = default;

    void PushFront(const Type& value) {
        head_.next_node = new Node(value, head_.next_node);
        ++size_;
    }

    void Clear() noexcept {
        while (head_.next_node != nullptr) {
            auto ptr_copy = head_.next_node;
            head_.next_node = ptr_copy->next_node;
            delete ptr_copy;
        }
        size_ = 0;
    }

    // Возвращает количество элементов в списке за время O(1)
    [[nodiscard]] size_t GetSize() const noexcept {
        return size_;
    }

    // Сообщает, пустой ли список за время O(1)
    [[nodiscard]] bool IsEmpty() const noexcept {
        return size_ == 0;
    }
    ~SingleLinkedList() {
        Clear();
    }

private:
    // Фиктивный узел, используется для вставки "перед первым элементом"
    Node head_;
    size_t size_ = 0;
};

template <typename Type>
void swap(SingleLinkedList<Type>& lhs, SingleLinkedList<Type>& rhs) noexcept {
    lhs.swap(rhs);
}

template <typename Type>
bool operator==(const SingleLinkedList<Type>& lhs, const SingleLinkedList<Type>& rhs) {
    if (&lhs == &rhs) return true;
    bool size_check = lhs.GetSize() == rhs.GetSize();
    bool check_values_equal = std::equal(lhs.cbegin(), lhs.cend(), rhs.cbegin());

    return check_values_equal && size_check;
}

template <typename Type>
bool operator!=(const SingleLinkedList<Type>& lhs, const SingleLinkedList<Type>& rhs) {
    return !(lhs == rhs);
}

template <typename Type>
bool operator<(const SingleLinkedList<Type>& lhs, const SingleLinkedList<Type>& rhs) {
    return std::lexicographical_compare(lhs.begin(), lhs.end(), rhs.begin(), rhs.end());
}

template <typename Type>
bool operator<=(const SingleLinkedList<Type>& lhs, const SingleLinkedList<Type>& rhs) {
    //пусть будет так
    return !(rhs < lhs);
}

template <typename Type>
bool operator>(const SingleLinkedList<Type>& lhs, const SingleLinkedList<Type>& rhs) {
    return rhs < lhs;
}

template <typename Type>
bool operator>=(const SingleLinkedList<Type>& lhs, const SingleLinkedList<Type>& rhs) {
    // Заглушка. Реализуйте сравнение самостоятельно
    return !(lhs < rhs);
}

void Test4() {
    struct DeletionSpy {
        ~DeletionSpy() {
            if (deletion_counter_ptr) {
                ++(*deletion_counter_ptr);
            }
        }
        int* deletion_counter_ptr = nullptr;
    };

    // Проверка PopFront
    {
        SingleLinkedList<int> numbers{ 3, 14, 15, 92, 6 };
        numbers.PopFront();
        assert((numbers == SingleLinkedList<int>{14, 15, 92, 6}));

        SingleLinkedList<DeletionSpy> list;
        list.PushFront(DeletionSpy{});
        int deletion_counter = 0;
        list.begin()->deletion_counter_ptr = &deletion_counter;
        assert(deletion_counter == 0);
        list.PopFront();
        assert(deletion_counter == 1);
    }

    // Доступ к позиции, предшествующей begin
    {
        SingleLinkedList<int> empty_list;
        const auto& const_empty_list = empty_list;
        assert(empty_list.before_begin() == empty_list.cbefore_begin());
        assert(++empty_list.before_begin() == empty_list.begin());
        assert(++empty_list.cbefore_begin() == const_empty_list.begin());

        SingleLinkedList<int> numbers{ 1, 2, 3, 4 };
        const auto& const_numbers = numbers;
        assert(numbers.before_begin() == numbers.cbefore_begin());
        assert(++numbers.before_begin() == numbers.begin());
        assert(++numbers.cbefore_begin() == const_numbers.begin());
    }

    // Вставка элемента после указанной позиции
    {  // Вставка в пустой список
        {
            SingleLinkedList<int> lst;
            const auto inserted_item_pos = lst.InsertAfter(lst.before_begin(), 123);
            assert((lst == SingleLinkedList<int>{123}));
            assert(inserted_item_pos == lst.begin());
            assert(*inserted_item_pos == 123);
        }

        // Вставка в непустой список
        {
            SingleLinkedList<int> lst{ 1, 2, 3 };
            auto inserted_item_pos = lst.InsertAfter(lst.before_begin(), 123);

            assert(inserted_item_pos == lst.begin());
            assert(inserted_item_pos != lst.end());
            assert(*inserted_item_pos == 123);
            assert((lst == SingleLinkedList<int>{123, 1, 2, 3}));

            inserted_item_pos = lst.InsertAfter(lst.begin(), 555);
            assert(++SingleLinkedList<int>::Iterator(lst.begin()) == inserted_item_pos);
            assert(*inserted_item_pos == 555);
            assert((lst == SingleLinkedList<int>{123, 555, 1, 2, 3}));
        };
    }

    // Вспомогательный класс, бросающий исключение после создания N-копии
    struct ThrowOnCopy {
        ThrowOnCopy() = default;
        explicit ThrowOnCopy(int& copy_counter) noexcept
            : countdown_ptr(&copy_counter) {
        }
        ThrowOnCopy(const ThrowOnCopy& other)
            : countdown_ptr(other.countdown_ptr)  //
        {
            if (countdown_ptr) {
                if (*countdown_ptr == 0) {
                    throw std::bad_alloc();
                }
                else {
                    --(*countdown_ptr);
                }
            }
        }
        // Присваивание элементов этого типа не требуется
        ThrowOnCopy& operator=(const ThrowOnCopy& rhs) = delete;
        // Адрес счётчика обратного отсчёта. Если не равен nullptr, то уменьшается при каждом копировании.
        // Как только обнулится, конструктор копирования выбросит исключение
        int* countdown_ptr = nullptr;
    };

    // Проверка обеспечения строгой гарантии безопасности исключений
    {
        bool exception_was_thrown = false;
        for (int max_copy_counter = 10; max_copy_counter >= 0; --max_copy_counter) {
            SingleLinkedList<ThrowOnCopy> list{ ThrowOnCopy{}, ThrowOnCopy{}, ThrowOnCopy{} };
            try {
                int copy_counter = max_copy_counter;
                list.InsertAfter(list.cbegin(), ThrowOnCopy(copy_counter));
                assert(list.GetSize() == 4u);
            }
            catch (const std::bad_alloc&) {
                exception_was_thrown = true;
                assert(list.GetSize() == 3u);
                break;
            }
        }
        assert(exception_was_thrown);
    }

    // Удаление элементов после указанной позиции
    {
        {
            SingleLinkedList<int> lst{ 1, 2, 3, 4 };
            const auto& const_lst = lst;
            const auto item_after_erased = lst.EraseAfter(const_lst.cbefore_begin());
            assert((lst == SingleLinkedList<int>{2, 3, 4}));
            assert(item_after_erased == lst.begin());
        }
        {
            SingleLinkedList<int> lst{ 1, 2, 3, 4 };
            const auto item_after_erased = lst.EraseAfter(lst.cbegin());
            assert((lst == SingleLinkedList<int>{1, 3, 4}));
            assert(item_after_erased == (++lst.begin()));
        }
        {
            SingleLinkedList<int> lst{ 1, 2, 3, 4 };
            const auto item_after_erased = lst.EraseAfter(++(++lst.cbegin()));
            assert((lst == SingleLinkedList<int>{1, 2, 3}));
            assert(item_after_erased == lst.end());
        }
        {
            SingleLinkedList<DeletionSpy> list{ DeletionSpy{}, DeletionSpy{}, DeletionSpy{} };
            auto after_begin = ++list.begin();
            int deletion_counter = 0;
            after_begin->deletion_counter_ptr = &deletion_counter;
            assert(deletion_counter == 0u);
            list.EraseAfter(list.cbegin());
            assert(deletion_counter == 1u);
        }
    }
}

