	int ch1, ch2, ch3; // для суммы
	int n;             // это для кол.-ва цифр

	ch1 = a % 10;
	a /= 10;
	ch2 = a % 10;
	a /= 10;
	ch3 = a % 10;

	if (ch3)
		n = 3;
	else if (ch2)
		n = 2;
	else if (ch1)
		n = 1;
	else
		n = 0;

	cout << "n: " << n << endl;
	cout << "s: " << ch1 + ch2 + ch3 << endl;
}

void nums2() {
	int a = 768;
	int s =0; // для суммы
	int n = 0;             // это для кол.-ва цифр

	if (a)
		n += 1;
	s += a % 10;
	a /= 10;
	
	if (a)
		n += 1;  // n = n + 1
	s += a % 10; // s = s + (a % 10)
	a /= 10;     // a = a / 10
	
	if (a)
		n += 1;
	s += a % 10;

	cout << "n: " << n << endl;
	cout << "s: " << s << endl;
}


